    [],nt"num_tags": 2,nt"name": "arrowwood-national-wildlife-refuge-narrative-report-january-february-march-april-1953",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Arrowwood NWR
    outlines Refuge accomplishments from January through April of 1953. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and wildfires. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
